import React from "react";
import "./Section22.sass";

class Section22 extends React.Component {
  render() {
    return (
      <div className="section-3 inter-normal-pale-sky-16px">
        <p className="paragraph-3">
          Dolor enim eu tortor urna sed duis nulla. Aliquam vestibulum, nulla odio nisl vitae. In aliquet pellentesque
          aenean hac vestibulum turpis mi bibendum diam. Tempor integer aliquam in vitae malesuada fringilla. Elit nisi
          in eleifend sed nisi. Pulvinar at orci, proin imperdiet commodo consectetur convallis risus.
        </p>
        <p className="paragraph-4">
          Ipsum sit mattis nulla quam nulla. Gravida id gravida ac enim mauris id.Diam elit, orci, tincidunt aenean
          tempus. Quis velit eget ut tortor tellus. Sed vel, congue felis elit erat nam nibh orci.
          <br />
          Non pellentesque congue eget consectetur turpis.
          <br />
          Sapien, dictum molestie sem tempor. Diam elit, orci, tincidunt aenean tempus. Quis velit eget ut tortor
          tellus. Sed vel, congue felis elit erat nam nibh orci.
        </p>
      </div>
    );
  }
}

export default Section22;
